import "bootstrap/dist/css/bootstrap.min.css";

import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Button } from "react-bootstrap";
import Card from "react-bootstrap/Card";
import Alert from "react-bootstrap/Alert";

function Donationhome() {
  const navigate = useNavigate();

  const [selected, setSelected] = useState("yes");
  const handleChange = (event) => {
    console.log(event.target.value);
    setSelected(event.target.value);
  };
  const styles = {
    cardstyle: {
      width: "29rem",
      marginBottom: "20rem",
    },
  };

  return (
    <>
      <div className="d-flex justify-content-center">
        <div className="pt-5 pb-5">
          <Card style={styles.cardstyle}>
            <Alert variant="secondary">
              <div className="d-flex justify-content-end mb-4">
              DONAR ID : 1212
              </div>
              <Alert.Heading className="d-flex justify-content-center">
                Please fill the details below
              </Alert.Heading>
            </Alert>
            <Card.Body>
              <form>
                <table>
                  <h6>Personal details</h6>
                  <Row>
                    <Col>
                      <input
                        name="donation_first_name"
                        placeholder="First Name"
                      />
                    </Col>
                    <Col>
                      <input
                        name="donation_last_name"
                        placeholder="Last Name"
                      />
                    </Col>
                  </Row>
                  <br></br>
                  <Row>
                    <h6>Address details</h6>
                  </Row>

                  <Row>
                    <Col>
                      <input name="country" placeholder="Country" />
                    </Col>
                    <Col>
                      <input name="country" placeholder="Country" />
                    </Col>
                  </Row>
                  <br></br>
                  <Row>
                    <h6>Contact details</h6>
                  </Row>

                  <Row>
                    <Col>
                      <input name="email" placeholder="Email id" />
                    </Col>
                    <Col>
                      <input name="mobile" placeholder="Mobile Number" />
                    </Col>
                  </Row>
                  <br></br>
                  <Row>
                    <h6>Donation type</h6>
                  </Row>
                  <input
                    type="radio"
                    id="money"
                    name="donationtype"
                    value="money"
                    checked={selected === "money"}
                    onChange={handleChange}
                  />
                  <label htmlFor="money">Donate Money</label>

                  <br></br>

                  <input
                    type="radio"
                    id="clothes"
                    name="donationtype"
                    value="clothes"
                    onChange={handleChange}
                    checked={selected === "clothes"}
                  />
                  <label for="clothes">Food/Clothes</label>

                  <br></br>
                  <br></br>

                  <Row>
                    <Col sm={7}>
                      <Button
                        className="d-flex justify-content-center"
                        onClick={() => {
                          if (selected === "money") {
                            navigate("/moneyhome");
                          } else if (selected === "clothes") {
                            navigate("/Foodcloth");
                          } else {
                            alert("Please select Donation type");
                          }
                        }}
                        variant="success"
                      >
                        Next
                      </Button>
                    </Col>
                    <Col sm={5}>
                      <Button
                        className="d-flex justify-content-right"
                        onClick={() => {
                          navigate("/");
                        }}
                        variant="success"
                      >
                        Back
                      </Button>
                    </Col>
                  </Row>
                </table>
              </form>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}

export default Donationhome;
